pragma solidity 0.5.0;


contract TowerGame {
    /* TOWER GAME

    The tower game is based on the idea o piling up wide rectangles in a 2D plane with gravity
    Players can choose the relative distance from the center vertical line of the plane to position
    then next rectangle on top of the previous. This contract will compute the static stability of 
    the rectangles assuming uniform density and equal mass and dimensions.

                      dx
                    |--->
              █████████████
        █████████████
           █████████████
       █████████████
    /=============\

    When a player executes a play, deposits a play price on the contract, `x`. 
    When a play causes `n` coins to fall, the player will be transfered `n*x` as prize.

    Players will call the play function with the desired relative position of the next coin `dx`
    This function will:
    1. Compute the stability of the current tower
    2. If it is unstable and will fall, transfer the prize to the msg.sender 
    3. Update the status of the tower, new coin position and number of coins

    */

    /* Last updated March 9 2018 */
    address public owner;
    uint32 public coinCount;
    uint public playPrice;
    uint constant public MAX_N = 30;
    int32[MAX_N] public coinPositionsArray;

    /* Game constants, coin width already set a half */
    int32 constant public COIN_WIDTH = 1000/2;

    event PlayResult(int32 dx, uint32 coinCount, int32 resultStability);

    constructor() public {
        owner = msg.sender;
        coinCount = 0;
        playPrice = 0.1 * 1000000000000000000;
    }

    modifier onlyOwner {
        if (msg.sender != owner) revert("Only owner");
        _;
    }

    function play(int32 dx) public payable {
        /* Verify user is paying the correct amount */
        assert(msg.value == playPrice);

        /* Update the dxs so the front-end can draw properly */
        /* dx = relative position from previous coin */
        coinPositionsArray[coinCount] = dx;
        int32 resultStability = checkStability(coinCount, COIN_WIDTH);
        /* resultStability = (if fall) new count (else) -1 */
        emit PlayResult(dx, coinCount, resultStability);

        if (resultStability >= 0) {
            /* Resolve a partial win */
            uint32 numberOfFallenCoins = 1+coinCount-uint32(resultStability);
            if (numberOfFallenCoins > 1) {
                /* Multiple coins have fallen */
                /* Only update count if it's necessary */
                coinCount = uint32(resultStability);
            } else {
                /* Only the last coin has fallen */
            }
            msg.sender.transfer(playPrice * numberOfFallenCoins);
        } else {
            /* Not a win, add coin to stack */
            coinCount++;
        }
    }

    function setPlayPrice(uint _playPrice) public onlyOwner {
        if (coinCount == 0) {
            playPrice = _playPrice;
        }
    }

    function kill() public onlyOwner {
        selfdestruct(msg.sender);
    }

    function checkStability(uint32 n, int w) internal view returns (int32) {
        /* (if fall) returns new count (else) returns -1 */
        /* input n is current coin count EXCLUDING the new */
        int32 res = -1;
        int f; 
        int k0 = 0; 
        int k1;
        uint32 i = n;
        // Scroll from top (n) to bottom (0)
        while (i < MAX_N && res < 0) {
        // factor f is 1 for the top coin then, sum 1 downwards
            f = n-i+1;
        // Maybe test the new coin alone to avoid adding uncessarily to storage
            k1 = (f-1)*k0/f+coinPositionsArray[i];
            k0 = k1;
            if (k1 > w) {
                res = int32(i);
            } else if (k1 < -w) {
                res = int32(i);
            }
            i--;
        }
        return res;
    }

}
